import React, { Component } from 'react';
import '../style/TAMeeting.css';

class TAMeeting extends Component { 

    render() {
        return (
            <>
                <div className='TAMeeting'>
                    <h3>Office Hours is</h3>
                    <h1>CLOSED</h1>
                    <h2>for our TA Meeting</h2>
                    <h3>Come back at 12:30!</h3>
                </div>
            </>
        )
    }
}

export default TAMeeting;
